import React from 'react';
import { Grid } from "@microsoft/fast-layouts-react";
import IncreaseButton from "./IncreaseButton.js";
import DecreaseButton from "./DecreaseButton.js";

export default  function InfoChanger(i, onClickDecrease, onClickIncrease){
    return (
        <Grid>
            <IncreaseButton
            i={i}
            onClickIncrease = {onClickIncrease}
            />
            <DecreaseButton
            i={i}
            onClickDecrease = {onClickDecrease}
            />
        </Grid>
    )
};
